import { ChartConfiguration, ChartType, ChartData, ChartOptions } from 'chart.js';
import 'chart.js/auto';
import {Doughnut, BarChart} from './components/Chart';
import WorldMap from './components/WorldMap';
import Test from "./components/test";


export interface myCustomChartConfig {
  type: ChartType,
  data: ChartData,
  options?: ChartOptions,
  width?: number,
  height?: number
}

function App(this: any) {

  var config: ChartConfiguration = {
    type: "bar",
    data: {
      labels: [
        'January',
        'February',
        'March',
        'April',
        'May',
        'June'],
      datasets: [
          {
              label: 'My First dataset',
              backgroundColor: ['rgb(205,92,92)'],
              borderColor: 'rgb(255, 99, 132)',
              data: [2, 10, 5, 2, 20, 30, 45] 
          }
      ]
    },
    options: {},
  }

  const styles = {
    colOv1: {
      backgroundColor: 'rebeccapurple',
      width: '100%'},
    hundred: {
        height: '100%',
        width: '100%'
    },
    colSpPie: {
        backgroundColor: 'burlywood'
    }

  };

  return (
    // <div>
    //   <Test/>
    //   <Doughnut type={config.type} data={config.data}/>
    // </div>
    // <!-- options need to be in one row each, else selector doesn't work-->

    <div>
            <div className="containerNavbar fixed-top">      
                <img id="navIMG" src='./resources/flag_ukraine.png' alt='flag_ukraine'/>
                <nav className="navbar">
                        <a className="navbar-brand" href="#">trade</a>
                    <ul className="nav justify-content-start">    
                        <select id="mySelect" className="selectpicker" title="countries" data-live-search="true">
                            <optgroup label="association">
                                <option data-content="<img style='margin-right:10px' src='../resources/flag_ukraine.png' alt='flag_ukraine' width='25' height='25'>NATO">NATO</option>
                                <option data-content="<img style='margin-right:10px' src='../resources/flag_ukraine.png' alt='flag_ukraine' width='25' height='25'>EU">EU</option>
                            </optgroup>
                            <optgroup id="myGroup" label="countries">
                                <option id="myItem" data-content="<img style='margin-right:10px' src='../resources/flag_ukraine.png' alt='flag_ukraine' width='25' height='25'>Germany">Germany</option>
                                <option data-content="<img style='margin-right:10px' src='../resources/flag_ukraine.png' alt='flag_ukraine' width='25' height='25'>Italy">Italy</option>
                            </optgroup>
                        </select>
                    </ul>
                </nav>
            </div>

            <div className="container">
                <div className="row firstRow">
                    <div className="col-md exportCol">
                        <div className="row export">
                            <h1>Export</h1>
                        </div>
                        <div className="row overview-bar">
                            <div className="col" style={styles.colOv1}>
                                <img id="navIMG" src='./bar.PNG' style={styles.hundred}/>
                            </div>
                        </div>
                        <div className="row specific-pie">
                            <div className="col" style={styles.colSpPie}>
                                <img id="navIMG" src='./pie.PNG' style={styles.hundred}/>
                            </div>
                        </div>
                    </div>
                    <div className="col-md importCol">
                        <div className="row import">
                            <h1>Import</h1>
                        </div>
                        <div className="row overview-bar">
                            <div className="col" style={styles.colOv1}>
                                <img id="navIMG" src='./bar.PNG' style={styles.hundred}/>
                            </div>
                        </div>
                        <div className="row specific-pie">
                            <div className="col" style={styles.colSpPie}>
                                <img id="navIMG" src='./pie.PNG' style={styles.hundred}/>
                            </div>
                        </div>
                    </div>
                </div>
                <WorldMap/>
            </div>
        </div>


  );
}

export default App;
